import Navbar from "./Navbar";
import Announcement from "./Announcement";
import Slider from "./Slider";
import Catergories from "./Categories"
import Products from "../components/Products"




function App(){
return(
    <div>
        <Announcement />
        <Navbar />
        <Slider />
        <Catergories />
        <Products />
        
    </div>
)

}

export default App;
